import React from "react";
import { MapContainer, TileLayer, GeoJSON } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import L from "leaflet";

const position = [19.432608, -99.133209];

function Maps(props) {
  const { selectPosition } = props;
  const locationSelection = [selectPosition?.lat, selectPosition?.lon];

  const customIcon = L.icon({
    iconUrl: require("./assets/marker.png"),
    iconSize: [38, 38],
  });

  return (
    <div className="map-container">
      <MapContainer
        center={position}
        zoom={13}
        style={{ height: "100vh", width: "100%" }}
      >
        <TileLayer
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          url="https://tile.openstreetmap.org/{z}/{x}/{y}.png"
        />

        {selectPosition && (
          <Marker position={locationSelection} icon={customIcon}>
            <Popup>
              A pretty CSS3 popup. <br /> Easily customizable.
            </Popup>
          </Marker>
        )}

        <GeoJSON
          url="/path/to/agebs_counts_updated.geojson" // Replace with the actual path to your GeoJSON file
          style={() => ({
            color: "blue", // Change polygon color here
            weight: 1,
            fillOpacity: 0.2,
          })}
        />
      </MapContainer>
    </div>
  );
}

export default Maps;
